import Block from '../Block';
export default class Youtube extends Block {
    getType() {
        return 'youtube';
    }
    getEmptyData() {
        var res = {
            html: '',
            caption: '',
        };
        return res;
    }
    isDataValid(data) {
        var keys = Object.keys(data);
        return keys.length === 2 && !_.isNil(data.html) && !_.isNil(data.caption);
    }
    getEmptyConfig() {
        return {};
    }
    mergeData(dest, src) {
        if (!_.isNil(src.html)) {
            dest.html = src.html;
        }
        if (!_.isNil(src.caption)) {
            dest.caption = src.caption;
        }
    }
}